var giftImageUrl = "data:image/png;base64,";
var rich = { /*定义颜色*/
    yellow: {
        color: "#ffc72b",
        fontSize: 16,
        padding: [5, 4],
        align: 'center',
    }
};
option = {
    tooltip: {
        trigger: 'item',
        formatter: "{a} <br/>{b} : {c} ({d}%)"
    },
    legend: {
        orient: 'vertical',
        left: 700, //控制lengend距离玫瑰图距离
        y: 'center',
        icon: 'circle',
        textStyle: {
            //color: ['#FEA72F', '#8BD3E0', '#00B3DE'],
            fontSize: 14,
            rich: rich, //!-- 填充颜色,
            width: 130,
            height: 20,
        },
        padding: [30, 0, 30, 0],
        itemWidth: 10,
        itemHeight: 5,
        itemGap: 20,
        data: ['大爷', '二爷', '三爷'],
        formatter: function(name) {
            let oa = option.series[0].data;
            let total = 0;
            oa.forEach((item, index) => {
                total += item.value;
            });
            for (let i = 0; i < oa.length; i++) {
                if (name == oa[i].name) {
                    // return name + '  ' + '{style'+i+'|' + (oa[i].value / total * 100).toFixed(2) + '%}';
                    return name + '  ' + oa[i].value + '岁 ' + '  ' + ' {yellow|' + (oa[i].value / total * 100).toFixed(2) + '%}';
                }
            }
        },
    },
    graphic: {
        elements: [{
            type: 'image',
            style: {
                image: giftImageUrl, //圆心设置图片
                width: 40,
                height: 40
            },
            left: 'center',
            top: 'center'
        }]
    },
    color: ['#FEA72F', '#8BD3E0', '#00B3DE'],
    // color:viewColor,
    calculable: false,
    series: [{
        name: '年龄',
        type: 'pie',
        radius: [10, '30%'], //第一个参数控制玫瑰图圆心大小,第二个参数控制玫瑰图大小
        center: ['55%', '50%'],
        roseType: 'radius',
        width: '100%', // for funnel
        max: 80, // for funnel
        itemStyle: {
            normal: {
                label: {
                    show: false
                },
                labelLine: {
                    show: false
                }
            },
            emphasis: {
                label: {
                    show: false
                },
                labelLine: {
                    show: false
                }
            }
        },
        // data:data,
        data: [{
                value: 1000,
                name: '大爷'
            },
            {
                value: 850,
                name: '二爷'
            },
            {
                value: 750,
                name: '三爷'
            }
        ]
    }]
};